import { authConstants } from "../actions/constants"

const initState = {
    name: 'Scarlet'
}
export const rootReducer =(state = initState, action) => {
    switch(action.type) {
        case authConstants.LOGIN_REQUEST:
            state = {
                ...state
            }
            break;
    }
    return state
}
